public Expression {
  public int precedence;
  public void Expression(int precendence){
    this.precendence = precendence;
  }
public double evaluate(){
  return Double.NaN;
}
public boolean higherPrecendanceThan(Expression expression){
  return this.precedence > expression.precendence;
}
}





public Number extends Expression{
  private double value;
  public void Number(double value){
    super(1);
    this.value = value;
  }
  public double evaluate(){
    return value;
  }
  public String toString(){
    return "" + value;
  }
}
